INSERT INTO public.user_company1 (id, display, closed, previev, date, usert, name, text, title, url, keywords, description, img, type, in_index, imgs, region, city, logo, phones, address, scheme, emails, services, rating, phone, tested, subscribe_product, subscribe_request, site, hash, subscribe_review, photos, coordinates, pars_company, coordinates_search, dizlike, liket, schedule, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, subscribe_product_insert, subscribe_request_insert, subscribe_review_insert, main_office, branch, phones_new, phones_edited, schedule_new, schedule_edited, address_legal, bank_details, credit_cards, date_reminders, info, save_price, under_order) VALUES ('28', '1', '0', 'Компания АвтоДепо работает на рынке автозапчастей с 2003 года. Основное направление компании оптовая и розничная продажа запасных частей на японские легковые и грузовые автомобили. Наша миссия — поставлять качественные запчасти для грузовой японской техники, доступные для российского потребителя, поэтому мы работаем только напрямую с производителями и в основном только с заводами Тайваня. Цена остается приемлемой, а качество достойным. ** Почему Тайвань? Так как это «золотая середина» между оригинальными японскими запчастями с высокой стоимостью и дешевыми товарами из Китая, качество которых оставляет желать лучшего. Товары поставляемые Компанией АвтоДепо, имеют все необходимые сертификаты соответствия российским стандартам. Заводы, выпускающие эти детали, имеют различные международные сертификаты менеджмента и качества производства. Мы гарантируем своим покупателям очень высокое качество продукции! Суммарный ассортимент товаров насчитывает более 9500 позиций! Радиаторы охлаждения двигателя, кондиционера, патрубки системы охлаждения, диффузоры и крыльчатки к ним, термостаты; Моторы отопителя салона (Гарантия 12 месяцев!), радиаторы отопителя салона, дополнительные печки салона; Детали ходовой части: линки, шаровые опоры, рулевые наконечники, рулевые продольные и поперечные тяги, маятники, рычаги; Диски сцепления, корзины сцепления, выжимные подшипники;, главные и рабочие цилиндры сцепления, пневмогидроусилители сцепления. Запчасти рессорной группы: листы рессорные коренные, подкоренные, заготовки по размерам, рессоры в сборе, пальцы рессорные, втулки, сайлентблоки, кронштейны, стремянки, рессорные болты, отбойники; Тормозная система: тормозные цилиндры, накладки, колодки, барабаны, диски, тормозные краны, пневмогидроусилители, масловлагоотделители, энергоаккумуляторы, тормозные камеры. Детали двигателя: поршни, гильзы, кольца поршневые, прокладки, ремкомплекты. Фары, габариты, повторители, противотуманные фары на легковые и грузовые автомобили; Кузовные детали: бампера, капоты, крылья, панели грузовиков, накладки на двери, уголки панели, подножки, ступеньки. Различные виды тросов: трос акселератора/газа, спидометра, КПП, тормоза, глушилки, коробки отбора мощности, а также наконечники к тросам; Гофры на глушители, бочки, трубы глушителя различных диаметров (длина 2 метра), трубы уголки; Электрика: генераторы, стартеры (Гарантия 12 месяцев!) И многие-многие другие детали от производителей Японии, Тайваня, Малайзии, Китая. На всю продукцию имеются сертификаты соответствия. Надежность и качество по доступным ценам!', '2016-02-21 04:27:23', '22', 'Автодепо', '', 'avtodepo', 'avtodepo', 'автодепо, для, качество, только, мы, товаров, сертификаты, имеют, детали, международные, автозапчастей, поставляемые, товары, на', 'Компания АвтоДепо работает на рынке автозапчастей с 2003 года.Основное направление продажа деталей для японских грузовых автомобилей.', '', '0', '0', 'a:7:{i:1;a:5:{s:4:\"temp\";s:0:\"\";s:4:\"file\";s:14:\"2845b5-la2.jpg\";s:4:\"name\";s:33:\"Свидетельсво ЕГРП\";s:5:\"title\";s:0:\"\";s:7:\"display\";s:1:\"1\";}i:2;a:5:{s:4:\"temp\";s:0:\"\";s:4:\"file\";s:31:\"2845b5-la2-ab0-2-5-0-cg5b-5.jpg\";s:4:\"name\";s:87:\"Свидетельсво о постановке на учет ИП Голенко АВ\";s:5:\"title\";s:0:\"\";s:7:\"display\";s:1:\"1\";}