INSERT INTO public.user_company1 (id, display, closed, previev, date, usert, name, text, title, url, keywords, description, img, type, in_index, imgs, region, city, logo, phones, address, scheme, emails, services, rating, phone, tested, subscribe_product, subscribe_request, site, hash, subscribe_review, photos, coordinates, pars_company, coordinates_search, dizlike, liket, schedule, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, subscribe_product_insert, subscribe_request_insert, subscribe_review_insert, main_office, branch, phones_new, phones_edited, schedule_new, schedule_edited, address_legal, bank_details, credit_cards, date_reminders, info, save_price, under_order) VALUES ('201', '1', '0', 'Ассортимент компании включает все категории автозапчастей: двигатели в сборе и по частям, детали кузова, оптику, лобовые и другие стекла, ноускаты (передние части автомобилей), бамперы, мосты, рессоры, радиаторы, карданы, передние подвески, навесное электрооборудование, и многое другое. Все эти запасные части \"контрактные\", т.е. получены от разукомплектации автомобилей, не имеющих пробега по России. Этим обуславливается приличного уровня качество при сравнительно невысоких ценах. Также в настоящее время в наличии имеются большой выбор запчастей для многих марок японских легковых автомобилей. Кроме того на складе находятся контрактные и новые автозапчасти для микроавтобусов, минивэнов, джипов. Если говорить о автомобилях, для которых мы предлагаем запчасти, то среди них значаться как самые популярные, так и редкие, как выпускаемые в настоящее время, так и выпуск которых уже давно прекращен модели Toyota, Nissan, Honda, Mitsubishi, Mazda, Suzuki, Subaru, Isuzu, Daihatsu. Поставки контрактных автозапчастей из Японии осуществляются ежемесячно. Также компания higashi-parts принимает заявки на поставку из Японии контрактных запчастей б/у и новых. Можем предложить услуги по организации отправок в регионы и по Хабаровскому краю. География уже осуществленных поставок охватывает практически все регионы России. Большинство клиентов становятся нашими постоянными покупателями.', '2017-02-20 14:06:28', '197', 'Higashi-Parts', '', 'higashi-parts', 'higashi-parts', 'higashi-parts', 'Higashi-Parts', '', '0', '0', '', '3', '16', '', '', 'ул. Аксёнова, 15 (р-н 11 гор. больницы)', '', 'a:1:{i:1;a:2:{s:5:\"email\";s:21:\"higashi-parts@mail.ru\";s:9:\"confirmed\";s:1:\"1\";}}', '8,15,18,9,10', '0.0', '', '0', '1', '1', '', 'd41d8cd98f', '1', 'a:17:{i:1;a:3:{s:4:\"file\";s:23:\"higashi-parts-d-b-5.jpg\";s:4:\"name\";s:26:\"higashi-parts фото (5)\";s:7:\"display\";s:1:\"1\";}i:2;a:3:{s:4:\"file\";s:23:\"higashi-parts-d-b-6.jpg\";s:4:\"name\";s:26:\"higashi-parts фото (6)\";s:7:\"display\";s:1:\"1\";}i:3;a:3:{s:4:\"file\";s:23:\"higashi-parts-d-b-7.jpg\";s:4:\"name\";s:26:\"higashi-parts фото (7)\";s:7:\"display\";s:1:\"1\";}i:4;a:3:{s:4:\"file\";s:23:\"higashi-parts-d-b-8.jpg\";s:4:\"name\";s:26:\"higashi-parts фото (8)\";s:7:\"display\";s:1:\"1\";}i:5;a:3:{s:4:\"file\";s:23:\"higashi-parts-d-b-9.jpg\";s:4:\"name\";s:26:\"higashi-parts фото (9)\";s:7:\"display\";s:1:\"1\";}i:6;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-10.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (10)\";s:7:\"display\";s:1:\"1\";}i:7;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-11.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (11)\";s:7:\"display\";s:1:\"1\";}i:8;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-12.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (12)\";s:7:\"display\";s:1:\"1\";}i:9;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-13.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (13)\";s:7:\"display\";s:1:\"1\";}i:10;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-14.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (14)\";s:7:\"display\";s:1:\"1\";}i:11;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-16.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (16)\";s:7:\"display\";s:1:\"1\";}i:12;a:3:{s:4:\"file\";s:24:\"higashi-parts-d-b-17.jpg\";s:4:\"name\";s:27:\"higashi-parts фото (17)\";s:7:\"