";s:7:\"display\";s:1:\"1\";}i:3;a:6:{s:3:\"day\";s:4:\"Ср\";s:7:\"start_h\";s:2:\"10\";s:7:\"start_m\";s:2:\"00\";s:8:\"finish_h\";s:2:\"18\";s:8:\"finish_m\";s:2:\"00\";s:7:\"display\";s:1:\"1\";}i:4;a:6:{s:3:\"day\";s:4:\"Чт\";s:7:\"start_h\";s:2:\"10\";s:7:\"start_m\";s:2:\"00\";s:8:\"finish_h\";s:2:\"18\";s:8:\"finish_m\";s:2:\"00\";s:7:\"display\";s:1:\"1\";}i:5;a:6:{s:3:\"day\";s:4:\"Пт\";s:7:\"start_h\";s:2:\"10\";s:7:\"start_m\";s:2:\"00\";s:8:\"finish_h\";s:2:\"18\";s:8:\"finish_m\";s:2:\"00\";s:7:\"display\";s:1:\"1\";}i:6;a:6:{s:3:\"day\";s:4:\"Сб\";s:7:\"start_h\";s:2:\"10\";s:7:\"start_m\";s:2:\"00\";s:8:\"finish_h\";s:2:\"15\";s:8:\"finish_m\";s:2:\"00\";s:7:\"display\";s:1:\"1\";}i:7;a:2:{s:3:\"day\";s:4:\"Вс\";s:7:\"display\";s:1:\"0\";}}', '1', '', 'Деньги за оплату товаров переводите на карту:\r\nСбербанк 4276 8500 2804 3294 Ирина Эдуардовна ДРУГИХ НОМЕРОВ КАРТ НЕТ!!!!!\r\n\r\nПРИ ПЕРЕВОДЕ ПОЛЕ СООБЩЕНИЕ ПОЛУЧАТЕЛЮ - ОСТАВЛЯЕМ ПУСТЫМ!!!! \r\n\r\nТел. +7 (423) 265-63-65 Звонки +7 950 281-62-03 (WhatsApp, Viber, SMS) (Учитывайте что время у нас другое! Москва +7 часов)\r\nВ личном сообщении(смс, ватсап,емеил) напишите свои данные ФАМИЛИЮ ИМЯ ОТЧЕСТВО, номер паспорта(только цифры), телефон и город куда отправлять груз (если ваш город маленький, то напишите ближайший большой город куда отправлять груз).\r\n\r\nУПАКОВКА:\r\nУПАКОВКА ПЛАСТИКОВЫХ ДЕТАЛЕЙ, ОПТИКИ, МЕЛОЧЕВКИ, И ПРОЧИХ ДЕТАЛЕЙ В КАРТОН И КАРТОННЫЕ КОРОБКИ.\r\nДВЕРИ, КРЫЛЬЯ И ДРУГИЕ НЕ КРУПНЫЕ ДЕТАЛИ ОБОРАЧИВАЮТСЯ В СТРЕЙЧ ПЛЕНКУ или КАРТОН И ОБМАТЫВАЮТСЯ СКОТЧЕМ. КАПОТЫ И ЧАСТИ АВТОМОБИЛЯ НЕ ПАКУЮТСЯ!!!\r\nУпаковка оговаривается перед оплатой заказа, в зависимости от объема работы, от 200р за заказ!(оговаривается отдельно)\r\nЕсли упаковка не была оговорена, то груз сдается в ТК без упаковки и упаковка делается ТК.\r\n\r\nУСЛОВИЯ :\r\nПереводом денег на карту Вы соглашаетесь с со следующими условиями работы:\r\n-МЫ НЕ НЕСЕМ НИКАКОЙ ОТВЕТСТВЕННОСТИ за работу Транспортных Компаний!\r\nЭто посредническая организация между вами и ними! Любые вопросы связанные с доставкой, местонахождением, утерей, недостачей, ломом и боем груза решаются с ТК вами! \r\n\r\n-Если вы приняли решение о покупке и сделали перевод на  карту, обратного пути уже нет! Отказаться от сделанного Вами заказа нельзя, все товары Б/У! Деньги за товар возвращаются на карту только в том случае если мы по какой либо причине не можем выполнить ваш заказ. Возврат по причине: &quot;Не подошло&quot;, &quot;А я думал&quot;, &quot;Мне сказали что подойдет или можно попробовать&quot;, &quot;Не пригодилось&quot; - НЕ ВОЗМОЖЕН И НЕ ПРИНИМАЕТСЯ!!!\r\n\r\nГАРАНТИЯ:\r\nАукционы Японии и Японцы не дают нам никаких гарантий на Авто купленные у них и запчасти, \r\nМы не предоставляю гарантию на ДВС, АКПП и другие детали подвески. Все нюансы оговариваются в процессе переписки.\r\nЕсли вас интересует гарантия, то вам нужно обратиться к дилеру за новыми запчастями.\r\nВсе детали Б/У и все решения о покупке и качестве приобретаемых деталей принимаются вами по предоставленным фотографиям.\r\n\r\nВремя на поверку 3(ТРИ) дня с момента получения заказа из ТК(отсчет по оригиналу накладной ТК)\r\nВремя на проверку предоставляется на следующие запчати: ДВС, АКПП, МКПП, Привода, Рулевые рейки, Ступицы, Стойки. При условии что все промаркированные места сохранены и не осуществлялся разбор!\r\nСайлентблоки, сальники, пыльники - это расходный материал и на них условия возврата не распространяются! \r\nДетали кузова, оптика, салон и пластик салона, литые диски, шины, колеса, элетроприборы и вся электрика приобритается исключительно в одну сторону и время на проверку не предоставляется, соответственно возврата и обмена нет!\r\n\r\nОТПРАВКА ЗАКАЗОВ:\r\n-Если вы не знаете какой тк вам отправить груз или не сообщили мне, то мы выбираем на свое усмотрение более выгодную в вашем направлении транспортную компанию сам и отправляю ей!\r\n\r\nОтправка производится следующими ТК :\r\n-ПЭК http://pecom.ru/\r\n-Энергия http://nrg-tk.ru/ \r\n-Деловые Линии http://www.dellin.ru/\r\n-Желдорэкспедиция http://www.jde.ru/\r\n-&quot;Мы с Камчатки&quot; \r\nОтправка ТК РАТЭК, ТК КИТ и ПОЧТОЙ РОССИИ НЕ ПРОИЗВОДИТСЯ!!!!!!\r\n\r\nДля всех наших клиентов у нас есть бесплатные услуги!\r\n\r\n-Консультация на тему взаимозаменяемости и подбора деталей к вашему авто\r\n\r\n-Бесплатная доставка груза до терминала транспортной компании, будь это ДВС, капот, ноускат или любые другие не крупногабаритные запчасти.(Если в заказе крыша, днище, задняя или передняя часть кузова, то доставка до ТК 1000р так как требуется заказ грузового автомобиля.)\r\n', '', '0000-00-00 00:00:00', '', '0', '');
