INSERT INTO public.user_company1 (id, display, closed, previev, date, usert, name, text, title, url, keywords, description, img, type, in_index, imgs, region, city, logo, phones, address, scheme, emails, services, rating, phone, tested, subscribe_product, subscribe_request, site, hash, subscribe_review, photos, coordinates, pars_company, coordinates_search, dizlike, liket, schedule, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, subscribe_product_insert, subscribe_request_insert, subscribe_review_insert, main_office, branch, phones_new, phones_edited, schedule_new, schedule_edited, address_legal, bank_details, credit_cards, date_reminders, info, save_price, under_order) VALUES ('348', '1', '0', 'В каталоге интернет-магазина авторазбора от компании Автовыбор 96 представлены запчасти на авто бу для всех пользующихся спросом в регионе легковых автомобилей. Здесь вы без труда подберете кузовщину, оптику, лобовые и дверные стекла, все, что требуется для ремонта КПП, трансмиссии, двигателя, аксессуары в салон и на кузов и многое другое. Основными конкурентными преимуществами сайта являются высокое качество поставляемых деталей с авторазбора и их доступная стоимость. Запчасти с разобранных автомобилей стоят намного дешевле, чем новые в розничных специализированных магазинах, а по качеству они порой превышают штамповку на частных производствах. Все разбираемые детали тщательно тестируются, проверяются на прочность и надежность и только потом поступают в продажу. По желанию заказчика возможна бесплатная доставка до Екатеринбурга или Челябинска, а при особо крупном заказе до самого места назначения. Все товары магазина сопровождаются официальной гарантией от специалистов авторазбора компании. Осуществляется продажа бу автозапчастей в любое время суток, без перерывов на выходные и праздничные дни. Это еще одно немаловажное преимущество интернет магазина. Заказчику не надо подстраиваться под часы работы магазина, можно посвятить этому удобное для себя время.', '