INSERT INTO public.user_company1 (id, display, closed, previev, date, usert, name, text, title, url, keywords, description, img, type, in_index, imgs, region, city, logo, phones, address, scheme, emails, services, rating, phone, tested, subscribe_product, subscribe_request, site, hash, subscribe_review, photos, coordinates, pars_company, coordinates_search, dizlike, liket, schedule, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, subscribe_product_insert, subscribe_request_insert, subscribe_review_insert, main_office, branch, phones_new, phones_edited, schedule_new, schedule_edited, address_legal, bank_details, credit_cards, date_reminders, info, save_price, under_order) VALUES ('695', '1', '0', 'Описание: Запчасти для американской грузовой техники.\r\nМы по прежнему поставляем расходные материалы и запасные части, необходимые для проведения ремонта американских седельных тягачей и полуприцепов.\r\n  ООО \"РЕГУЛ\"- не первый год занимается продажей на территории России оригинальных запчастей для американской грузовой техники. Мы поставляем своим заказчикам как новые, так и б/у запчасти – оптом и в розницу, по наличному и безналичному расчёту.\r\nКачество нашей работы с первого дня существования интернет-магазина запчастей ООО \"РЕГУЛ\" соответствует самым высоким запросам.\r\n  Обращаясь к нам, вы можете быть уверенны в качественном подборе нужной вам запчасти, так как наши менеджеры руководствуются оригинальными электронными каталогами и многолетним опытом.\r\n  Приобретая у нас б/у запчасть можете не сомневаться в ее работоспособности. Тщательные осмотр и проверка каждой детали специалистами нашего автосервиса, позволяют нам отбирать только работоспособные экземпляры. Предлагая своим клиентам автозапчасти, в которых мы уверены, мы выстраиваем отношения с заказчиками на основе доверия и взаимопонимания, что очень важно для репутации интернет-магазина запчастей. \r\n  А также, можно не беспокоиться, что при транспортировке что-то пострадает: каждая деталь тщательно упаковывается.\r\nСТО:\r\n  Кроме того специалистами компании выполняется качественный ремонт грузовиков FREIGHTLINER, VOLVO VNL,KENWORTH, INTERNATIONAL,PETERBILT, а также весь модельный ряд европейских грузовиков и полуприцепов,в кратчайшие сроки с учетом всех особенностей этих автомобилей. Наши специалисты занимаются ремонтом различной сложности – они устраняют мелкие неисправности, ремонтируют трансмиссию, ходовую часть, проводят капитальный ремонт двс . \r\n Также мы проводим компьютерную диагностику трансмиссии, двигателя, модуля управления, системы АБС и пневматической подвески. \r\nУслуги по диагностике развала-схождения колес грузовых автомобилей и прицепной технике. \r\n\r\n  Мы предлагаем комплексное техобслуживание грузовых автомобилей , которое состоит из замены расходных материалов, диагностики технического состояния ходовой части и узлов, компьютерной диагностики двигателя. На современном оборудовании наши специалисты выявляют и предлагают устранить неисправности во время ремонта или обслуживания грузовых автомобилей . \r\n\r\n  На территории рем. зоны есть мойка , асфальтированная стоянка 1 ГА , круглосуточная вооруженная охрана и видеокамеры по всей площади. \r\n\r\n  Мы предлагаем вполне доступную стоимость ремонтных работ . Предоставляем фирменную гарантию. \r\n    \r\n Также мы проводим компьютерную диагностику трансмиссии, двигателя, модуля управления, системы АБС и пневматической подвески. \r\nУслуги по диагностике развала-схождения колес грузовых автомобилей и прицепной технике. \r\n\r\n  Мы предлагаем вполне доступную стоимость ремонтных работ . Предоставляем фирменную гарантию. \r\n    \r\n  Магазин запчастей находится по адресу: г Уссурийск ул. Кирова 69 ( напротив АЗС Октант)  \r\n  СТО  по адресу: г. Уссурийск с. Новоникольск ул. Писарева 138.', '2017-12-22 08:24:43', '761', 'ИП Лавренчук', '', 'ip-lavrenchuk', 'ip-lavrenchuk', 'лавренчук, ип', 'ИП Лавренчук', '', '0', '0', '', '1', '11', 'logo.png', '', 'Новоникольск, ул. Писарева, 138\r\nул.  Кирова 69 ( напротив АЗС Октант)', '', 'a:1:{i:1;a:2:{s:5:\"email\";s:14:\"dvtk-1@mail.ru\";s:9:\"confirmed\";s:1:\"1\";}}', '8,10,26', '0.0', '', '0', '1', '1', 'www.dvtk-1.ru', '1358f1901a', '1', 'a:14:{i:1;a:3:{s:4:\"file\";s:26:\"1410842479403_bulletin.jpg\";s:4:\"name\";s:22:\"1410842479403_bulletin\";s:7:\"display\";s:1:\"1\";}i:2;a:3:{s:4:\"file\";s:26:\"1410842484594_bulletin.jpg\";s:4:\"name\";s:22:\"1410842484594_bulletin\";s:7:\"display\";s:1:\"1\";}i:3;a:3:{s:4:\"file\";s:26:\"1410842540418_bulletin.jpg\";s:4:\"name\";s:22:\"1410842540418_bulletin\";s:7:\"display\";s:1:\"1\";}i:4;a:3:{s:4:\"file\";s:26:\"1411361628854_bulletin.jpg\";s:4:\"name\";s:22:\"1411361628854_bulletin\";s:7:\"display\";s:1:\"1\";}i:5;a:3:{s:4:\"file\";s:26:\"1441862768506_bulletin.jpg\";s:4:\"name\";s:22:\"1441862768506_bulletin\";s:7:\"display\";s:1:\"1\";}i:6;a:3:{s:4:\"file\";s:19:\"20160504_085821.jpg\";s:4:\"name\";s:15:\"20160504_085821\";s:7:\"display\";s:1:\"1\";}i:7;a:3:{s:4:\"file\";s:19:\"20160420_094631.jpg\";s:4:\"name\";s:15:\"20160420_094631\";s:7:\"display\";s:1:\"1\";}i:8;a:3:{s:4:\"file\";s:13:\"02-5-gc-1.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (1)\";s:7:\"display\";s:1:\"1\";}i:9;a:3:{s:4:\"file\";s:13:\"02-5-gc-4.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (4)\";s:7:\"display\";s:1:\"1\";}i:10;a:3:{s:4:\"file\";s:13:\"02-5-gc-5.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (5)\";s:7:\"display\";s:1:\"1\";}i:11;a:3:{s:4:\"file\";s:13:\"02-5-gc-6.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (6)\";s:7:\"display\";s:1:\"1\";}i:12;a:3:{s:4:\"file\";s:13:\"02-5-gc-7.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (7)\";s:7:\"display\";s:1:\"1\";}i:13;a:3:{s:4:\"file\";s:13:\"02-5-gc-8.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (8)\";s:7:\"display\";s:1:\"1\";}i:14;a:3:{s:4:\"file\";s:13:\"02-5-gc-9.jpg\";s:4:\"name\";s:27:\"ИП Лавренчук (9)\";s:7:\"display\";s:1:\"1\";}}', '(43.8167353, 131.94905870000002)', '0', 'уссурийск ул. Кирова 69', '0', '5', '', '1', '0', '0', '0', '0',