ex • Клапан двигателя (впуск/выпуск) Stellite • Фильтр сетка топлив. Форсунки FSP,OEM Gasket • Кольцо топливной форсунки OEM Gasket - Наличный. - Доставка по г. Красноярску для оптовых покупателей бесплатно. ✈ Отправка в регионы. (При отправке в другие города применяем фирменный скотч, что поможет избежать хищений.) - Весь ассортимент компании в наличии на складах в г. Красноярске. Длительные партнерские отношения с ведущими транспортными компаниями позволяют доставлять автозапчасти в любую точку России, страны СНГ и дальнего зарубежья. Отправляем запчасти во все регионы России транспортными компаниями: Энергия, Деловые линии, Сдэк и др Самовывоз : Семафорная 261д Благодаря непрерывному контролю качества за используемыми материалами и постоянному совершенствованию технологий производства, бренд OEM Gasket соответствует всем требованиям, что подтверждается сертификатами качества ISO9001 и TS16949.™ Fudex Патрубки радиатора (Сделано в Малайзии) TOTO Pistons Original Комплекты поршней и гильз RIK, высококлассные поршневые кольца. Фирма «RikagakuKogyo» создана в далеком 1927 г. на территории Японии. Компанию основал Институт физических и химических исследований. В те времена фирма 1-ая в Японии начинает полномасштабное производство поршневых колец. TEIKIN Торговая марка TEIKIN создана индонезийской компание PT.EDICO UTAMA (г.Джакарта) в 1974 году. Сферой деятельности компании является поставка на автомобильные рынки Восточной, Юго-Восточной Азии запчастей для японских и корейских автомобилей. Ассортимент запчастей включает в себя поршни, гильзы цилиндров, поршневые кольца, аккумуляторные батареи и высоковольтные провода. Subaru, Suzuki, Toyota, Mitsubishi, Isuzu, Honda, Nissan, Daihatsu, Komatsu, Kubota, Hyundai, Hino, Daihatsu, и Yamaha – вот неполный перечень потребителей продукции TEIKIN.', '2018-02-19 07:27:25', '850', 'ATTL', '', 'attl', 'attl', 'attl', 'ATTL', '', '0', '0', '', '23', '48', 'oem-4sfe-04111-74280.jpg', '', 'ул.Семафорная 261д', '', 'a:1:{i:1;a:2:{s: