INSERT INTO public.user_company1 (id, display, closed, previev, date, usert, name, text, title, url, keywords, description, img, type, in_index, imgs, region, city, logo, phones, address, scheme, emails, services, rating, phone, tested, subscribe_product, subscribe_request, site, hash, subscribe_review, photos, coordinates, pars_company, coordinates_search, dizlike, liket, schedule, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, subscribe_product_insert, subscribe_request_insert, subscribe_review_insert, main_office, branch, phones_new, phones_edited, schedule_new, schedule_edited, address_legal, bank_details, credit_cards, date_reminders, info, save_price, under_order) VALUES ('831', '1', '0', 'Мы, одна из крупных компаний в Челябинске по продаже контрактных запчастей из Японии\r\n\r\nНа рынке авто запчастей без пробега по РФ более 7 лет. Предлагаем Вам приобрести запчасти из наличия, а также работаем под заказ (поставщики по всей России, срок исполнения заказа от 3-х дней)\r\n\r\nВ наличии тысячи деталей, имеющих малые пробеги и большой ресурс. В среднем пробег авто, поступившего к нам на склад от 40-80т.км\r\n\r\nА именно, мы предлагаем:\r\n\r\n-Двигатели (с документами таможни, нет проблем с оформлением в ГИБДД)\r\n-КПП (АКПП, Вариаторы, МКПП)\r\n-Навесное оборудование (генераторы, стартеры, насос ГУР, катушки, форсунки и т.д)\r\n-Кузовные детали (ноускаты, бампера, крылья, капоты, двери и т.д.)\r\n-Ходовая часть (стойки, рулевые рейки, рычаги, ступицы, диски тормозные, суппорта и т.д)\r\n-Электрика (датчики, переключатели, моторчики печки, блоки управления и т.д.)\r\n\r\n \r\n5 причин работать с нами:\r\n\r\n- подход к каждому клиенту\r\n- помощь в подборе автозапчастей\r\n- гарантия на детали\r\n- запчасти в наличии\r\n- низкая цена за качественные детали\r\n\r\nДействует система скидок для постоянных клиентов', '2018-05-16 07:42:02', '922', 'Autohelp (контрактные запчасти из Японии)', '', 'avtohelp', 'avtohelp', 'автохелп', 'АвтоХелп', '', '0'